import React from 'react';
import { render } from '@testing-library/react';

const toolbar = props => (

    <header>
        <nav>
            <div></div>
            <div><a href="/">THE LOGO</a></div>
            <div>
                <ul>
                    <li><a href="/">Contact</a></li>
                    <li><a href="/">About</a></li>
                </ul>
            </div>
        </nav>
    </header>
);

export default toolbar;
